// HomePage.js
import React from 'react';
import Navbar from '../components/navbar';

const HomePage = () => {
  return (
    <div>
      <Navbar />
      <div style={{ textAlign: 'center', padding: '2rem' }}>
        <h1>Welcome to FuelToBuild</h1>
        <p>Get fit with personalized programs and expert tips!</p>
      </div>
    </div>
  );
};

export default HomePage;
